import React, { Component } from 'react';
import { Typography } from '@material-ui/core';
import './blm-links.css';

/**
 * BLMLinks class
 */
class BLMLinks extends Component {
  /**
   * Render the BLMLinks component
   * @returns {ReactElement}
   */
  render() {
    return (
      <div className="page-container">
        <Typography variant='h6'>
          BLM Links:
        </Typography>
        <Typography variant='h6'>
          Petitions:
        </Typography>
        <p>
          <a href="https://www.linkedin.com/in/natwag/">link 1</a>
        </p>
        <Typography variant='h6'>
          Info:
        </Typography>
        <p>
          <a href="https://www.linkedin.com/in/natwag/">link 1</a>
        </p>
        <Typography variant='h6'>
          Donate:
        </Typography>
        <p>
          <a href="https://www.reddit.com/r/proplifting/">link 3</a>
        </p>
      </div>
    );
  }
}

export default BLMLinks;
